import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Product from "./components/product/Product";
import Basket from "./components/myBasket/basket";

const App = () => {
  const products = [
    { id: 1, name: "Big Mac", description: "Tasty burger", price: 120, image: "/images/big_mac.jpg" },
    { id: 2, name: "Chicken McNuggets", description: "Crispy nuggets", price: 100, image: "/images/chicken_nuggets.jpg" },
    { id: 3, name: "French Fries", description: "Crunchy fries", price: 50, image: "/images/french_fries.jpg" },
  ];

  return (
    <Router>
      <Routes>
        {/* Render Product Component for each product */}
        {products.map((product) => (
          <Route
            key={product.id}
            path={`/product`}
            element={<Product product={product} />}
          />
        ))}

        {/* Basket Route */}
        <Route path="/basket" element={<Basket />} />
      </Routes>
    </Router>
  );
};

export default App;
